import React, { useState } from "react";
import IndexNavbar from "components/Navbars/IndexNavbar.js";
import Footerr from "components/Footers/Footerr";

function MyTickets() {
  const [selectedTicket, setSelectedTicket] = useState(null);

  const tickets = [
    {
      id: 1,
      sujet: "Problème d'accès au portail client",
      departement: "Support Technique",
      statut: "Ouvert",
      date: "2024-03-15",
      description: "Impossible d'accéder à mon espace client depuis hier soir.",
    },
    {
      id: 2,
      sujet: "Question sur un virement international",
      departement: "Opérations Bancaires",
      statut: "En cours",
      date: "2024-03-14",
      description: "Demande d'information sur les frais de virement vers l'Asie.",
    },
    {
      id: 3,
      sujet: "Carte bloquée à l'étranger",
      departement: "Cartes Bancaires",
      statut: "Résolu",
      date: "2024-03-10",
      description: "Déblocage de ma carte Visa Premier en Australie.",
    },
  ];

  return (
    <>
      <IndexNavbar />

      <div style={backgroundStyle}>
        <div style={containerStyle}>
          <h1 style={titleStyle}>Mes Tickets</h1>

          <div style={ticketListStyle}>
            {tickets.map((ticket) => (
              <div
                key={ticket.id}
                style={ticketStyle}
                onClick={() => setSelectedTicket(ticket)}
              >
                <h3>{ticket.sujet}</h3>
                <p>{ticket.departement}</p>
                <p style={statusStyle(ticket.statut)}>{ticket.statut}</p>
                <p>{ticket.date}</p>
              </div>
            ))}
          </div>

          {selectedTicket && (
            <div style={detailStyle}>
              <h2>Détails du Ticket</h2>
              <button
                onClick={() => setSelectedTicket(null)}
                style={closeButtonStyle}
              >
                ×
              </button>
              <p><strong>Sujet:</strong> {selectedTicket.sujet}</p>
              <p><strong>Statut:</strong> {selectedTicket.statut}</p>
              <p><strong>Date:</strong> {selectedTicket.date}</p>
              <p><strong>Description:</strong> {selectedTicket.description}</p>
            </div>
          )}
        </div>
      </div>

      <Footerr />
    </>
  );
}

// Styles simplifiés
const backgroundStyle = {
  backgroundColor: "#f7f7f7",
  padding: "20px 0",
};

const containerStyle = {
  maxWidth: "900px",
  margin: "0 auto",
  padding: "0 20px",
};

const titleStyle = {
  textAlign: "center",
  fontSize: "2rem",
  marginBottom: "30px",
  color: "#2c3e50",
};

const ticketListStyle = {
  display: "grid",
  gridTemplateColumns: "1fr",
  gap: "15px",
  marginBottom: "30px",
};

const ticketStyle = {
  backgroundColor: "#fff",
  border: "1px solid #ddd",
  borderRadius: "8px",
  padding: "15px",
  cursor: "pointer",
  transition: "all 0.3s ease",
};

const statusStyle = (status) => {
  const colors = {
    "Ouvert": "#e74c3c",
    "En cours": "#f39c12",
    "Résolu": "#2ecc71",
  };
  return {
    color: colors[status] || "#3498db",
    fontWeight: "bold",
  };
};

const detailStyle = {
  backgroundColor: "#fff",
  padding: "20px",
  borderRadius: "8px",
  border: "1px solid #ddd",
};

const closeButtonStyle = {
  backgroundColor: "transparent",
  border: "none",
  fontSize: "20px",
  color: "#7f8c8d",
  cursor: "pointer",
  float: "right",
};

export default MyTickets;
